sample1 = [100,100]
import numpy as np

def calculate_pai_score(heart_rate_data):
    c1 = 10.1817
    c2 = 5.7808
    c3 = 41.9374
    c4 = 9.8382
    ymax = 199
    yth = 80
    time_period = 60*24*7
    heart_rate_data = [x for x in heart_rate_data if x is not None]
    heart_rate_data = np.array(heart_rate_data)
    normalized_intensity = (heart_rate_data - yth) / (ymax - yth)
    intensity_score = c1 * (np.exp(c2 * normalized_intensity) - 1)
    activity_score = np.average(intensity_score)*time_period
    pai_score = c3 + c4 * (1 - np.exp(-np.average(intensity_score)))
    pai_score = min(pai_score, 100)  # Cap PAI score at 100
    print(pai_score)

def calculate_activity_score(heart_rate_data):
    c1 = 10.1817
    c2 = 5.7808
    c3 = 41.9374
    c4 = 9.8382
    ymax = 199
    yth = 80
    time_period = 60*24*7
    heart_rate_data = np.array(heart_rate_data)
    
    # Normalize heart rate
    yt = (heart_rate_data - yth) / (ymax - yth)
    
    # Calculate intensity score
    zt = c1 * (np.exp(c2 * yt) - 1)
    
    # Calculate activity score using trapezoidal rule
    activity_score = -time_period * np.trapz(zt)
    
    # Calculate health-predictive activity score
    pai_score = c3 + c4 * (1 - np.exp(activity_score))
    
    return pai_score

